using System;
using UnityEngine;

public class Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5\u01C5\u01C5\u01C5
{
    public static void \u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5()
    {
        if (BitUtils.GetBit(StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5\u01C5))
        {
//            Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5.noClipToggler.btnOn.SetActive(false);
//            Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5.noClipToggler.btnOff.SetActive(true);
            BitUtils.ClearBit(ref StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5\u01C5);
            return;
        }
//        Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5.noClipToggler.btnOn.SetActive(true);
//        Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5.noClipToggler.btnOff.SetActive(false);
        BitUtils.SetBit(ref StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5\u01C5);
    }

    public static void \u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5()
    {
        if (BitUtils.GetBit(StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5))
        {
//            Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5.flyToggler.btnOn.SetActive(false);
//            Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5.flyToggler.btnOff.SetActive(true);

            BitUtils.ClearBit(ref StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5);
            return;
        }
//        Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5.flyToggler.btnOn.SetActive(true);
//        Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5.flyToggler.btnOff.SetActive(false);

        BitUtils.SetBit(ref StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5);
    }


    public static void \u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ()
    {

        /*
        if (ModuleStatus.isCharacterTeleport)
        {
            ModuleStatus.isCharacterTeleport = false;
            return;
        }
        */
        Vector3 VectorSpeed = new Vector3();
        if (BitUtils.GetBit(StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5))
        {
            VectorSpeed[0] = VRC.Player.Instance.GetComponent<CharacterController>().velocity.x / 200 * (int)BlazeEngineAssembly.assembly.GetType("Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5\u01C5\u01C5\u01C5").GetField("\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5").GetValue(null);
        }
        if (BitUtils.GetBit(StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5\u01C5))
        {
            VectorSpeed[1] = VRC.Player.Instance.GetComponent<CharacterController>().velocity.y / 200 * (int)BlazeEngineAssembly.assembly.GetType("Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5\u01C5\u01C5\u01C5").GetField("\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5").GetValue(null) * 0.1f;
        }
        if (BitUtils.GetBit(StatusBuff.enabledMods, Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ.\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5))
        {
            VectorSpeed[2] = VRC.Player.Instance.GetComponent<CharacterController>().velocity.z / 200 * (int)BlazeEngineAssembly.assembly.GetType("Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5\u01C5\u01C5\u01C5\u01C5\u01C5").GetField("\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5").GetValue(null);
        }
        VRC.Player.Instance.GetComponent<CharacterController>().Move(VectorSpeed);
    }

    // Speed JH
    public static object \u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5\u01C5;
    // Speed SH
    public static object \u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5Ǆ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5ǅ\u01C5;
}
